    "2013-03-15T23:20:06.984046",nt"name": "some-magnetite-deposits-of-stevens-and-okanogan-counties-washington-report-of-investigations-14",nt"isopen":
    false,nt"url": null,nt"notes": "This report consists of the descriptions,
    based on detailed magnetic surveys, of five magnetite deposits in northeastern Washington.
    They are: the Big Iron deposit in the Orient district of northern Stevens County,
    the Read and Connors deposits in the Cedar Canyon district of southern Stevens County,
    and the Crystal Butte and Strawberry Lake deposits in the Myers Creek district of
    northeastern Okanogan County. All of these deposits have at least two things in
    common. First, they are genetically of the same type, having been formed by replacement
    of old metasedimentary rocks at or near contacts with intrusive granitic rocks,
    and they all have similar mineral composition, being composed essentially of magnetite
    and iron sulphides in varying amounts. Second, they are all of relatively small
    size when considered as potential supplies of iron are for support of an iron and
    steel industry in Washington. All of the deposits are easily accessible by unimproved
    roads, a situation that may somewhat augment development despite their small size.",nt"license_title":
